import classes from "./Skills.module.css";

const Skills = () => {
  const td =
    ({
      name: "Javascript",
    },
    {
      name: "Reactjs",
    },
    {
      name: "Reactjs",
    },
    {
      name: "Reactjs",
    },
    {
      name: "Reactjs",
    },
    {
      name: "Reactjs",
    },
    {
      name: "Reactjs",
    });
  //   name: ,
  //   "",
  //   "HTML",
  //   "CSS",
