  //   "JSON",
  //   "SASS",
  //   "Figma",
  //   "Github",
  //   "Bootstrap",
  //   "Responsive Design",
  // ];
  const tdMap = td.map((item) => {
    <td>{item.name}</td>;
  });

  return (
    <div className={classes.container}>
      <table>
        <tbody>
          <tr className={classes.tr}>
            {tdMap}
            {/* <td>Javascript</td>
            <td>Reactjs</td>
            <td>HTML</td>
